## Issue Basics
- ObjectBox version : *2.2.0*
- Reproducibility: *occasionally without visible pattern*

## Description
I received the crash when i put an entity in the box. 
I can't reproduce the crash, but i received a lot of exception issues because of the crash in my error tracing reports.
The data.mdb file is a dozen of MB, so i don't think the objectbox capacity is not enough.

## Stacks Traces
![image](https://user-images.githubusercontent.com/6631824/50476713-1e89b900-0a04-11e9-961a-84754bdd3701.png)


`syncDataToDB` method is invoked very frequently, almost once per second. I don't know if there were some causes.


## Code
```java
private void syncDataToDB(String courseId,
                              String courseName, String coachName,
                              boolean isPkMode, String redName, String blueName,
                              TrainingCourse.TrainingUser trainingUser) {
        DBCourseData dbCourseData = mDBCourseDataByCIdQuery.setParameter(DBCourseData_.courseId, courseId).findFirst();
        if (dbCourseData == null) {
            dbCourseData = new DBCourseData();
        }
        ...
        mDBCourseDataBox.put(dbCourseData);

        DBUserData dbUserData = mDBUserDataByCIdUIdQuery.setParameter(DBUserData_.courseId, courseId).setParameter(DBUserData_.userId, trainingUser.userId).findFirst();
        if (dbUserData == null) {
            dbUserData = new DBUserData();
        }
        ...
        mDBUserDataBox.put(dbUserData); //  =====> Line: 1170
    }
```

The `DBUserData` entity was defined like this.

```java
@Entity
public class DBUserData {
    @Id
    public long id;

    public String courseId;
    public String userId;

    public boolean newUserDialogShown;
    public boolean oldUserDialogShown;
    public boolean birthDayDialogShown;
    public boolean newRecordDialogShown;
    public int score; 
    public float cal;
    public float ck;
    public int highestHR; 

    public String userIcon;
    public String username;
    public int sex;

    // pk mode
    public boolean isRed;
    public int trainingNum;
    public int victoryNum;
    public int defeatNum;
    public int drawNum;

}
```

Hope you will get my points.
Thanks a lot.

comment.body:
If you could share some code that might help to understand the context better. But, I'll try anyway... :slightly_smiling_face: 

This is an example from an internal test; it's a tree with branches and leaves. A leaf has a parent relation to the branch:

```
    obx_model_entity(model, "DataLeaf", 1, 6348606983323322409);
    if (syncEnabled) obx_model_entity_flags(model, OBXEntityFlags_SYNC_ENABLED);
    obx_model_property(model, "id", OBXPropertyType_Long, 1, 7352554494005967060);
    obx_model_property_flags(model, OBXPropertyFlags_ID);
    obx_model_property(model, "parentId", OBXPropertyType_Relation, 2, 6351202743278204154);
    obx_model_property_flags(model,
                             (OBXPropertyFlags) (OBXPropertyFlags_INDEXED | OBXPropertyFlags_INDEX_PARTIAL_SKIP_ZERO));
    obx_model_property_relation(model, "DataBranch", 1, 7077739940711775368);
```
As you can see you need some flags to enable the index for the relation property.

Also, obx_model_property_relation is likely of interest, as it tells to which entity type the relation refers to. Here are the C API docs for it:

```
/// Refine the definition of the property declared by the most recent obx_model_property() call, declaring it a
/// relation.
/// @param target_entity The name of the entity linked to by the relation
/// @param index_id Must be unique within this version of the model
/// @param index_uid Used to identify relations between versions of the model. Must be globally unique.
OBX_C_API obx_err obx_model_property_relation(OBX_model* model, const char* target_entity, obx_schema_id index_id,
                                              obx_uid index_uid);

```
Hope that helps in a way. Note that we are a bit busy at the moment, I hope that we can start looking into your PRs in about 2 weeks.

